import axios from "axios";
import './App.css';
import {useEffect, useState} from "react";

function App() {
    const [arr, setarr]=useState(false);
    const array=[]
    useEffect(()=>{
        axios.get("https://api.music.msub.kr/?song=Life%20is%20Good").then(res=>{
            let data=res.data;
            array.push(data.lineup);
            setarr(true);
        })
    }, []);

    if(arr) return null;
  return (
      <div>
          {array[0]}
      </div>
  );
}

export default App;
